(function() {
  $.fn.animalesDisponibles = function(origcategoria_id, origrodeo_id, origestado_id) {
    return $.ajax({
      type: "POST",
      url: $('#root_path').val() + 'rga/animales/disponibles',
      data: {
        origcategoria_id: origcategoria_id,
        origrodeo_id: origrodeo_id,
        origestado_id: origestado_id
      },
      dataType: "script"
    });
  };

  $.fn.rgaActualizarCategorias = function(evento_id, codigo) {
    return $.ajax({
      type: "GET",
      url: $('#root_path').val() + 'rga/eventos/' + evento_id + '/actualizar_categorias',
      data: {
        codigo: codigo
      },
      dataType: "script"
    });
  };

  $.fn.rgaActualizarEstados = function(evento_id, categoria_id, solicitante, codigo) {
    return $.ajax({
      type: "GET",
      url: $('#root_path').val() + 'rga/eventos/' + evento_id + '/actualizar_estados',
      data: {
        categoria_id: categoria_id,
        solicitante: solicitante,
        codigo: codigo
      },
      dataType: "script"
    });
  };

}).call(this);
















